import React from 'react'

const Button = ({text, clicked, type}) => {
    const btnType = type

    if(type === 'send'){
        btnType = [Send]
    } 
    return (
        <>
            <button className={btnType} onClick={clicked}>{text}</button>
        </>
    )
}

export default Button
